import logo from './logo.svg';
import './App.css';
import ExpenseItem from './component/ExpenseItem';

function App() {
  const expenses = [
    { title: 'Car Insurance', amount: 295.1, date: new Date(2021, 2, 20) },
    { title: 'Car Insurance', amount: 300.1, date: new Date(2021, 2, 20) },
    { title: 'Car Insurance', amount: 295.1, date: new Date(2021, 2, 20) },
  ];
  return (
    <div className="App">
      <h1>My React App!</h1>
      <ExpenseItem></ExpenseItem>
    </div>
  );
}

export default App;
